import React, { useState } from "react";
import {View,Text, FormControl,Input,InputField, InputSlot, InputIcon,} from "@gluestack-ui/themed";
import { EyeIcon, EyeOffIcon } from "lucide-react-native";
import { useFormik } from 'formik';
import {initialValues} from './RegisterForm.data'
import { TouchableOpacity } from "react-native";


const Register = () => {

  const formik = useFormik({
        initialValues: initialValues(),
        onSubmit: (formValue) => {
            console.log("Formulario enviado")
        }
  });

  const [showPassword, setShowPassword] = useState(false);
  const handleState = () => {
    setShowPassword((showState) => {
      return !showState;
    });
  };

  return (
    <View>
      <FormControl
        isInvalid={false}
        size={"lg"}
        isDisabled={false}
        isRequired={true}
        w={"$4/5"}
        justifyContent="center"
        marginTop={"$5"}
      >
        <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
          <InputField type="text" placeholder="Email" backgroundColor="white" 
          onChangeText={text => formik.setFieldValue("email", text)}/>
        </Input>
      </FormControl>

      <FormControl
        isInvalid={false}
        size={"lg"}
        isDisabled={false}
        isRequired={true}
        w={"$4/5"}
        marginTop={"$5"}
      >
        <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
          <InputField
            type={showPassword ? "text" : "password"}
            placeholder="Password"
            backgroundColor="white"
            
          />
          <InputSlot pr="$3" onPress={handleState} backgroundColor="white">
            <InputIcon
              as={showPassword ? EyeIcon : EyeOffIcon}
              color="$darkBlue500"
            />
          </InputSlot>
        </Input>
      </FormControl>

      <FormControl
        isInvalid={false}
        size={"lg"}
        isDisabled={false}
        isRequired={true}
        w={"$4/5"}
        marginTop={"$5"}
      >
        <Input borderRadius="$2xl" borderWidth="$0" h={"$12"}>
          <InputField
            type={showPassword ? "text" : "password"}
            placeholder="Confirm Password"
            backgroundColor="white"
            
          />
          <InputSlot pr="$3" onPress={handleState} backgroundColor="white">
            <InputIcon
              as={showPassword ? EyeIcon : EyeOffIcon}
              color="$darkBlue500"
            />
          </InputSlot>
        </Input>
      </FormControl>

      <TouchableOpacity
            style={{
              backgroundColor: "black",
              padding: 10,
              borderRadius: 16,
              alignItems: "center",
              width: 110,
            }}
            onPress={formik.handleSubmit}
          >
            <Text color="white" fontSize={18}>
              Login
            </Text>
        </TouchableOpacity>
          

    </View>
  );
};

export default Register;
